			console.log("Err", err);
		});

		response.data.forEach((product) => {
			const { id, title, image, price } = product;
			arrayItem.push({ id, title, image, price, favorite: false });
		});

		console.warn("1. dispatch - рендера карточек");
		dispatch(setProducts(arrayItem));
